import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header>
        <span id="app-name">Axis</span>
      </header>
      <section id="app-body">
        Poo
      </section>
    </div>
  );
}

export default App;
